import React from 'react'

function SkillsList({skills}) {
  return (
    <div>
        {skills.map((skill) => {
            return (
                <SkillCard key={skill.id} skillName={skill.name} level={skill.level} />
            );
        })}
    </div> 
  )
}

export default SkillsList
